import React from "react";
import './style/main.css';


export default function Popup (p) {
    return (p.trigger) ? (
      <>
      <div class="delete-blk">
        {p.children}
      </div>
      <button type="submit" className="delete-button">
        <span className="submit-btntxt textsmsemibold">Tải xuống</span>
      </button></>
    ) : ""
}
